sys_variable_value.value:
(function execute(inputs, outputs) {
//var request=inputs.req;

var today = new GlideDateTime();
//gs.info(today);

var day = today.getDayOfMonthLocalTime().toString().padStart(2,'0');
var month = today.getMonthLocalTime().toString().padStart(2,'0');
var year = today.getYearLocalTime();

//gs.info(day + ", " + month + ", " + year);
var formattedDate = day + '/' + month + '/' + year;
outputs.date=formattedDate;


var formattedDateFile = day + '' + month + '' + year;  

//var appNumber=request.appNum;
//gs.info(appNumber);
//var filename = appNumber + '_ACR_' + formattedDateFile + '_1.pdf';
var filename = '_ACR_' + formattedDateFile + '_1.pdf';

outputs.filename = filename;

})(inputs, outputs);

